var background;
var logo;

window.onload = function () {
    var backgroundCanvas = document.getElementById("backgroundCanvas");
    var width = 1200;
    var height = 630;
    background = new ImageCropper(backgroundCanvas, backgroundCanvas.width / 2 - width / 2, backgroundCanvas.height / 2 - height / 2, width, height, true);
    
    var logoCanvas = document.getElementById("logoCanvas");
    var width = 200;
    var height = 200;
    logo = new ImageCropper(logoCanvas, logoCanvas.width / 2 - width / 2, logoCanvas.height / 2 - height / 2, width, height, true);
    
    window.addEventListener('mouseup', preview);
    window.addEventListener('touchend', preview);
};
function preview() {
    if (background.isImageSet()){
        var backgroundImg = background.getCroppedImage(1200, 630);
        backgroundImg.onload = (function () {
            if (logo.isImageSet()){ 
                var logoImg = logo.getCroppedImage(200, 200);
                logoImg.onload = (function () {
                    return previewLoaded(backgroundImg, logoImg); 
                });
            }
        });
    }   
    if (logo.isImageSet()){
        var logoImg = logo.getCroppedImage(200, 200);
        logoImg.onload = (function () { 
            if (background.isImageSet()){ 
                var backgroundImg = background.getCroppedImage(1200, 630);
                backgroundImg.onload = (function () {
                    return previewLoaded(backgroundImg, logoImg); 
                });
            }
        });
    }
}
function previewLoaded(backgroundImg, logoImg) {
    if (backgroundImg && logoImg) {
        var previewCanvas = document.getElementById('previewCanvas');
        var context = previewCanvas.getContext('2d');

        var background = new Image();
        background.onload = function() {
          context.drawImage(this, 0, 0);
        };
        background.src = backgroundImg.src;

        var darken = new Image();
        darken.onload = function() {
          context.drawImage(this, 0, 0);
        };
        darken.src = "data:image/png;base64,";

        var mvlogo = new Image();
        mvlogo.onload = function() {
          context.drawImage(this, 200, 200);
        };
        mvlogo.src = "data:image/png;base64,";

        var plus = new Image();
        plus.onload = function() {
          context.drawImage(this, 580, 295);
        };
        plus.src = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAACgAAAApCAYAAABHomvIAAAAX0lEQVRYhe3XwQ0AIAjFUDDsvzJO4KmYcOgb4KfxJNndMeA1knT40IHfDKQMpAykDKQMpAykDKQMpCrev+EJeHv9CxpIrQ+sGDgNw7NzMQMpAykDKQMpAykDKQOp9YEXglkHUpknfO4AAAAASUVORK5CYII=";

        var plogo = new Image();
        plogo.onload = function() {
          context.drawImage(this, 800, 215);
        };
        plogo.src = logoImg.src;

        document.getElementById('result').style.display = "block";
    }
}
function handleFileSelect(evt) {
    var file = evt.target.files[0];
    var reader = new FileReader();
    var img = new Image();

    img.addEventListener("load", function () {
        background.setImage(img);
        preview();
    }, false);

    reader.onload = function () {
        img.src = reader.result;
    };

    if (file) {
        reader.readAsDataURL(file);
    }
}

function handleLogoSelect(evt) {
    var file = evt.target.files[0];
    var reader = new FileReader();
    var img = new Image();

    img.addEventListener("load", function () {
        logo.setImage(img);
        preview();
    }, false);

    reader.onload = function () {
        img.src = reader.result;
    };

    if (file) {
        reader.readAsDataURL(file);
    }
}


var downloaddbtn = document.getElementById('btn-download');
downloaddbtn.addEventListener('click', function (e) {
    var dataURL = document.getElementById('previewCanvas').toDataURL('image/jpg');
    downloaddbtn.href = dataURL.replace(/^data:image\/[^;]/, 'data:application/octet-stream');
});


document.getElementById('fileInput').addEventListener('change', handleFileSelect, false);
document.getElementById('logoInput').addEventListener('change', handleLogoSelect, false);